하지만 스틱이 떨어지면서 그 아래있던 설명서를 들춰보니 캡슐구멍이 있더라구요.
4구캡슐용박스에 스틱을 넣은것인데 전용박스를 제작하시는게 좋을듯싶어요. 저는 그 구멍을 보자마자 가격줄일려고 캡슐두개빼고 구멍가리고 스틱넣은거같이 보였거든요. 받는사람 입장에서는 그냥 딱 열어보다 저처럼 생각하실분이 분명 많으실거예요. 물론 가격이 더 저렴한건 사실이지만요. 기분차이잖아요^^;;
